def fit_index_return(param_value, input_data, historical_data):    if param_value['type'] == 'Expert Model':        #Already has values put in        pass    elif param_value['type'] == 'Normal Fitted':        #Add mu and std        data = historical_data.pure_returns["index_return"]        param_value["mu"] = data.mean()        param_value["std"] = data.std()    else:        raise NotImplementedError                def fit_basket_return(param_value, input_data, historical_data):    if param_value['type'] == 'Expert Model':        #Already has values put in        pass    elif param_value['type'] == 'Normal Fitted':        #Add mu and std        data = historical_data.pure_returns["basket_return"]        param_value["mu"] = data.mean()        param_value["std"] = data.std()    else:        raise NotImplementedError